import { Avatar, Button, Container, TextField, Typography } from '@material-ui/core';
import React from 'react';
import style from '../Tool/Style';
import LockOpenIcon from '@material-ui/icons/LockOpen';

const Login = () => {
    return (
        <Container maxWidth="xs">
            <div style={style.paper}>
                <Avatar style={style.avatar}>
                    <LockOpenIcon style = {style.icon}/>
                </Avatar>

                <Typography component ="h1" variant="h5">
                    Login de Usuario
                </Typography>

                <form style={style.form}>
                    <TextField name="username" variant="outlined" label="Ingrese username"  fullWidth margin="normal"/>
                    <TextField name="username" type="password" variant="outlined" label="password"  fullWidth margin="normal" />
    
                    <Button type="submit" fullWidth variant="contained" color="primary" style={style.submit}>
                        Enviar
                    </Button>
                </form>
                
            </div>
        </Container>
    );
};

export default Login;
